    false,nt"url": null,nt"notes": "This narrative report for Sand Lake NWR
    outlines Refuge accomplishments from January through April of 1943. The report begins
    by summarizing the weather conditions, water conditions, and food and cover during
    this period. Wildlife- including migratory birds, upland game birds, big game animals,
    furbearers, predators, rodents, mammals, raptors, fish, and disease- is also covered.
    The Refuge development and maintenance section discusses physical developments,
    plantings, collections and receipts, and wildfires. Resource management is outlined;
    topics include grazing and fur harvesting. A progress report on field investigations
    and applied research is also provided. The public relations section of the report
    describes Refuge visitors. Photographs are attached.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
